    public class func drawFilterArrow() {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Bezier Drawing
        CGContextSaveGState(context)
        CGContextTranslateCTM(context, 16.84, 14.97)
        CGContextRotateCTM(context, -45 * CGFloat(M_PI) / 180)
        CGContextScaleCTM(context, 1, -1)

        var bezierPath = UIBezierPath()
        bezierPath.moveToPoint(CGPointMake(-3.45, 7.64))
        bezierPath.addLineToPoint(CGPointMake(-3.45, -3.67))
        bezierPath.addLineToPoint(CGPointMake(7.87, -3.67))
        StyleKit.gray.setStroke()
        bezierPath.lineWidth = 1
        bezierPath.stroke()

        CGContextRestoreGState(context)
    }

