    public class func drawFilterCategoryGeneral(#iconColor: UIColor, iconCircle: UIColor) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Symbol Drawing
        let symbolRect = CGRectMake(3, 6, 35, 35)
        CGContextSaveGState(context)
        UIRectClip(symbolRect)
        CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y)

        StyleKit.drawCategoryGeneral(frame: CGRectMake(0, 0, symbolRect.size.width, symbolRect.size.height), iconColor: iconColor)
        CGContextRestoreGState(context)


        //// Symbol 2 Drawing
        let symbol2Rect = CGRectMake(0, 0, 42, 42)
        CGContextSaveGState(context)
        UIRectClip(symbol2Rect)
        CGContextTranslateCTM(context, symbol2Rect.origin.x, symbol2Rect.origin.y)

        StyleKit.drawFilterIconCircle(iconCircle: iconCircle)
        CGContextRestoreGState(context)
    }

