        //// tile-dimension 2 Drawing
        let tiledimension2Path = UIBezierPath(rect: CGRectMake(0, 0, 43, 50))
        CGContextSaveGState(context)
        tiledimension2Path.addClip()
        CGContextScaleCTM(context, 1, -1)
        CGContextDrawTiledImage(context, CGRectMake(0, 0, tiledimension.size.width, tiledimension.size.height), tiledimension.CGImage)
