    public class func drawIconMavenLogo(#iconColor: UIColor) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Symbol Drawing
        let symbolRect = CGRectMake(-5, 7, 61, 37)
        CGContextSaveGState(context)
        UIRectClip(symbolRect)
        CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y)
        CGContextScaleCTM(context, symbolRect.size.width / 90, symbolRect.size.height / 54)

        StyleKit.drawLogoMaven(iconColor: iconColor)
        CGContextRestoreGState(context)
    }

